import React,{Component} from 'react';
import {connect } from 'react-redux';
import {
    ListWidget,
    ListItem,
    ListItemText,
    ListItemTextTile,
    ListItemTextBody

} from '../style';
class List extends Component{
    render(){
        const { list } =this.props;
        return (
           <ListWidget>
               {
                   list.map((item)=>{
                       return(
                        <ListItem>
                            <img className='ListImg' src='https://upload-images.jianshu.io/upload_images/2257068-610cbe7de087b61c?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240' alt='' />
                        <ListItemText>
                                <ListItemTextTile>{item.get('title')}</ListItemTextTile>
                                <ListItemTextBody>文章分为五个部分： 1.写在前面的话 2.120斤与95斤 3.减肥方法分析 4.饮食与运动（干货） 5.写在最后 一、写在前面的话 我一直觉得...</ListItemTextBody>
                        </ListItemText>
                    </ListItem>
                       )
                   })
               }
           </ListWidget>
        )
    }
}   
const mapState=(state)=>({
    list:state.getIn(['Home','list'])
})
export default connect(mapState,null)(List);
